import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

const root = ReactDOM.createRoot(document.getElementById('root'));

export default function App(){
  return (
    <div>
      <h1>Hello World!</h1>
    </div>
  );
}
root.render(
    <App/>
);

